INSERT INTO `youtube_channels` (`profile_picture`, `name`, `description`, `id`, `channel_id`) VALUES
('https://yt3.ggpht.com/Vy6KL7EM_apxPSxF0pPy5w_c87YDTOlBQo3MADDF0Wl51kwxmt9wmRotnt2xQXwlrcyO0Xe56w=s88-c-k-c0x00ffffff-no-rj', 'Linus Tech Tips', 'Linus Tech Tips is a passionate team of \"professionally curious\" experts in consumer technology and video production who aim to educate and entertain.\n', 10, 'UCXuqSBlHAE6Xw-yeJA0Tunw'),
('https://yt3.ggpht.com/p2cg2LI1SBuY6c5dkXLhMVORpbMQ3AZGb-lmHqBaFM6qkceq2EdqDER9cRhw_KFGoBQRioia=s88-c-k-c0x00ffffff-no-rj', 'Muse Asia', 'Muse Communication is trusted by our clients and has been named as the agent of more than 30 well-known anime and manga copyright partners in the global anime market. The company has expanded its influence in the anime and manga community by expanding its presence in the media, becoming a strategic marketing partner for its clients, and creating licensing opportunities. We provide our clients with a wide range of professional services in licensing, distribution, development, sales, and promotion to meet all their needs and achieve benefits.\n\nWe provide clients with an all-rounded service to satisfy all your distribution needs.We work with over a hundred different entertainment platforms including internet services, TV stations, TV/OTT platforms across the whole of Asia.\n', 14, 'UCGbshtvS9t-8CW11W7TooQg'),
('https://yt3.ggpht.com/ytc/AOPolaQQxK4M-4zN-_tiA8Zv1-5uIufet7teNgxjm_BclQ=s88-c-k-c0x00ffffff-no-rj', 'ABS-CBN Entertainment', 'Watch your favorite entertainment shows from the leading television network!\n\nSubscribe to ABS-CBN Entertainment channel! - https://bit.ly/ABS-CBNEntertainment\n\nVisit our official websites!\nhttps://entertainment.abs-cbn.com/tv/home\nhttps://www.push.com.ph\n\nFacebook: \nhttps://www.facebook.com/ABSCBNnetwork\n\nTwitter: \nhttps://twitter.com/ABSCBN\n\nInstagram: \nhttps://instagram.com/abscbn', 15, 'UCstEtN0pgOmCf02EdXsGChw'),
('https://yt3.ggpht.com/JfcqVinxsIc8dYsPIrp6IBDRMBb420BqVd2bzS9wqcMWBTzmnjUJ74Q0VByY1gUA8p-AYZQzxQ=s88-c-k-c0x00ffffff-no-rj', 'developedbyed', 'Hello my gorgeous friends on the internet, welcome to DevelopedByEd, your go-to channel for learning how to code, design, and become more creative in the tech world!\n\nI’m Ed, a self-taught full stack engineer and designer from Romania, and I\'ve been teaching code since 2018. I make learning fun and simple, covering topics such as web development, web design, UI/UX, game development, tech-related news, 3D modelling, and more!\n\nWhether you\'re a beginner or an experienced developer, I have coding courses and tutorials suitable for any level. I specialize in front-end, full-stack, and design, and I\'m dedicated to sharing my knowledge and expertise with you! \n\nAnd the best part? You can use any of the amazing projects you see in my tutorials or courses in your portfolios!\n\nSo, if you want to kickstart your tech career, head over to https://developedbyed.com and find affordable courses that will take you to the next level! 💻\n', 19, 'UClb90NQQcskPUGDIXsQEz5Q');
